import React from "react";
import { Link } from "react-router-dom";
//import { BrowserRouter, Route, Link } from "react-router-dom";

class Navbar extends React.Component {
    render() {
        return (
            <nav class="navbar bg-light border navbar navbar-expand-md navbar-light">
                <div class="container-fluid">
                    <Link class="navbar-brand" to="/dashboard">IT Management</Link>
                    <div class="collapse navbar-collapse" id="navbar">
                        <ul class="navbar-nav me-auto mt-0">
                            <li class="nav-item"><Link class="nav-link" to="/users">Users</Link></li>
                            <li class="nav-item"><Link class="nav-link" to="/departments">Departments</Link></li>
                            <li class="nav-item"><Link class="nav-link" to="/submit_tickets">Submit Ticket</Link></li>
                        </ul>
                        <ul class="navbar-nav ms-auto mt-2">
                                <li class="nav-item"><Link class="nav-link" href="/">Log Out</Link></li>
                        </ul>
                    </div>
                </div>
            </nav>
        );
    }
}

export default Navbar;
